<script>
  // Panel toggle
  const panel = document.getElementById('rightpanel');
  const btnClose = document.getElementById('panelClose');
  const btnOpen = document.getElementById('panelOpen');
  function hidePanel() {
    panel.style.transform = 'translateX(110%)';
    btnOpen.style.display = 'block';
  }
  function showPanel() {
    panel.style.transform = 'translateX(0)';
    btnOpen.style.display = 'none';
  }
  btnClose.addEventListener('click', hidePanel);
  btnOpen.addEventListener('click', showPanel);

  // Generic overlay toggler: find the matching label in Leaflet's overlay list and click it
  window.toggleOverlay = function(labelText) {
    const labels = document.querySelectorAll('.leaflet-control-layers-overlays label');
    for (const lab of labels) {
      if (lab.textContent.trim() === labelText.trim()) {
        lab.querySelector('input[type="checkbox"]').click();
        break;
      }
    }
  };
</script>
